import React from "react";
import ReactDOM from "react-dom";

function ContactCard() {
    return (
      <>
        <h1>Here's how to get in touch with me:</h1>
        <ul>
          <li>LinkedIn</li>
          <li>Github</li>
          <li>Email</li>
          <li>CV</li>
        </ul>
      </>
    );
}

export default ContactCard
